ЕПИЛОГ јучерашњег напада на екипу КТВ и мене:

- техничару су избијена три зуба (тешка телесна повреда),
-Данијел, Синиша и ја имамо мноштво отеклина и подлива,
-озбиљна оштећења камере и опреме,
- нула ухапшених насилника!

Кривични законик у члану 344а забрањује насилничко понашање на јавном скупу а став 4 истог члана каже: 

"Ako je izvršenjem dela iz stava 1. ovog člana došlo do nereda u kome je nekom licu naneta teška telesna povreda ili je oštećena imovina veće vrednosti,
učinilac će se kazniti zatvorom od tri do dvanaest godina."

